<p style="margin:0px;">设置执行器</p>
<p style="margin:0px;">执行器相当于一个或者多个相同名字的执行客户端，executor.appname代表执行器的名字</p>
<p style="margin:0px;">执行器需要在web控制台配置并人工选择执行</p>
